import React from "react";
import Slider from 'react-slick'

const Testimonials = () => {
    return <Slider>
        <div className="testimonial py-4 px-3">
            <p>Lorem ipsum dolor sit amet, corrumpit posidonium disputationi te his. Ad magna iudico deserunt vis, cum sumo inermis ne, ei altera regione consulatu mea. No animal explicari eam, veritus signiferumque vix ne, sed in fabulas petentium voluptatum?</p>
        </div>
    </Slider>
};

export default Testimonials;
